import React from 'react'
import Card from '../component/Card'
export default class CardContainer extends React.Component{

    mapFunc(){
        return this.props.cards.map(word => {
            return <Card word = {word} />
        })
    }
    render(){

        return (
            <div>
            {this.mapFunc()}
            </div>
        )
    }
}
